Masker spirulina banyak mengandung zat anti oksidan B1, B5, B6 and C, mineral zinc, mangan, tembaga, asam amino esensial, betakaroten, vitamin E dan masker spirulina juga memiliki kandungan khusus yaitu gamma linoleic acid yang hanya ditemukan pada biji-bijian dan buah-buahan. Kandungan gamma linoleic acid dan 18 asam amino esensial pada masker spirulina sangat bermanfaat untuk menjaga kesehatan dan kelembaban sel kulit dan otot pada wajah anda.
